def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    for block in data.blocks:
        try:
            result = self.grouper.aggregate(block.values, how, axis=1, min_count=min_count)
        except NotImplementedError:
            # Perform the operation in an alternate way (if applicable)
            if alt is not None:
                try:
                    result = get_groupby(self.obj[block.mgr_locs], self.grouper).aggregate(
                        lambda x: alt(x, axis=self.axis)
                    )
                except TypeError:
                    # Exclude the block if there's an exception in trying to aggregate
                    continue
                else:
                    result = cast(DataFrame, result)._data.blocks[0].values
                    if result.ndim == 1:
                        result = result.reshape(1, -1)
        # Continue to handle other block types, as appropriate
    return agg_blocks, data.items
